import TourCard from "../shared/TourCard";
export const SearchResultList = () => {
  return (
    <>
      <CommonSection title={"Tour Search Resukt"} />
      <section>
        <Container>
          <Row></Row>
        </Container>
      </section>
    </>
  );
};
